        [TestMethod()]
        public void QuantileLowerTest() {
            Console.WriteLine(dist);
            for (int i = 0; i <= 100000; i++) {
                Float128 p = (Float128)i / 100000;
                Float128 x = dist.Quantile(p, Interval.Lower);
                Float128 cdf = dist.CDF(x, Interval.Lower);

                Console.WriteLine($"quantile({p})={x}, cdf({x})={cdf}");

                if (Float128.IsFinite(x)) {
                    Assert.IsTrue(Float128.Abs(p - cdf) < 1e-32);
                }
            }
        }

        [TestMethod()]
        public void QuantileUpperTest() {
            Console.WriteLine(dist);
            for (int i = 0; i <= 100000; i++) {
                Float128 p = (Float128)i / 100000;
                Float128 x = dist.Quantile(p, Interval.Upper);
                Float128 ccdf = dist.CDF(x, Interval.Upper);

                Console.WriteLine($"cquantile({p})={x}, ccdf({x})={ccdf}");

                if (Float128.IsFinite(x)) {
                    Assert.IsTrue(Float128.Abs(p - ccdf) < 1e-32);
                }
            }
        }

